import {SearchOutlined} from '@ant-design/icons';
import { useState } from 'react';




function HomeSearch(){
    let [inputShow,setInputShow]=useState(false)
    function seachInputOut(){
        setInputShow(inputShow=>!inputShow)
    }
    return (
        <div className="homesearch">
            <SearchOutlined onClick={()=>seachInputOut()}/>
            <input className={inputShow?'inputShow':'input'} style={{transi}}></input>
        </div>
    )
}

export default HomeSearch
